import Card from "../components/Card";

function Favourites({
	items,
	searchValue,
	setSearchValue,
	onChangeSearchInput,
	onAddToFavorite,
	onAddToCart,
}) {
	return (
		<div className="content p-40">
			<div className="d-flex align-center justify-between mb-40">
				<h1>
					Мои закладки
				</h1>

			</div>

			<div className="d-flex flex-wrap">
				Тут будут мои закладки
			</div>
		</div>
	);
}

export default Favourites;
